INSERT INTO `food` VALUES (26,'草莓冰淇淋','好吃的草莓冰淇淋，在浑南校区食堂一楼可以找到',3.00,100,1,'2022-04-07 02:23:17','2022-04-07 02:23:17'),(27,'蛋包饭','食堂一楼\n酱猪肉丝->鱼香肉丝\n现有素什锦（？）、鸡丁、鸡块、护心肉等多种，价格不等',10.00,60,1,'2022-04-08 06:44:07','2022-04-08 07:11:54'),(28,'自助餐','一楼自助餐，以人多著称。价格根据称重而定',10.00,100,1,'2022-04-08 06:44:55','2022-04-08 06:44:55'),(29,'打卤面','食堂一楼\n曾经四种卤子相同价格，现在部分涨价了不允许混着吃了\n——卤子不要钱（雾）',7.00,60,1,'2022-04-08 07:11:28','2022-04-08 07:11:28'),(30,'牛肉拉面','食堂一楼\n手工拉面，不是很好吃',10.00,60,1,'2022-04-08 07:13:41','2022-04-08 07:13:41'),(31,'盒饭','食堂一楼\n出现过香菇炖鱼的神奇菜品',10.00,60,1,'2022-04-08 07:14:26','2022-04-08 07:14:26'),(32,'烤盘拌饭','食堂二楼',13.00,60,1,'2022-04-08 07:15:18','2022-04-08 07:15:18'),(33,'套餐','食堂二楼',10.00,60,1,'2022-04-08 07:15:32','2022-04-08 07:15:32'),(34,'粗粮细作','食堂二楼\n此处拥有米线、粗粮等多种',10.00,60,1,'2022-04-08 07:15:58','2022-04-08 07:15:58'),(35,'黄焖鸡米饭','食堂二楼\n将鸡肉和土豆单独做好，再混在一起的做法\n注：和另外一种混合就是鸡公煲',10.00,60,1,'2022-04-08 07:16:51','2022-04-08 07:16:51'),(36,'私房牛肉面','食堂二楼\n拥有多种面条，由其中西红柿牛肉面（14）和私房牛肉面（12）的价格得知西红柿两块钱\n注：较多的队伍和旁边的清水鱼片几乎无人形成了鲜明的对比',12.00,60,1,'2022-04-08 07:18:38','2022-04-08 07:18:38'),(37,'葱油拌面','食堂三楼\n由清汤面得知，葱油的价格为2块\n但又由其他面得知，葱油不要钱',8.00,100,1,'2022-04-08 07:19:58','2022-04-08 07:19:58'),(38,'齐品达烤肉饭','食堂三楼\n来食堂点外卖.jpg\n在有多人分摊的情况下可能不如外卖便宜（？）',13.00,60,1,'2022-04-08 07:21:06','2022-04-08 07:21:06'),(39,'烤肉饭','食堂三楼\n排队较少',10.00,60,1,'2022-04-08 07:21:28','2022-04-08 07:21:28'),(40,'两荤套餐','食堂三楼',12.00,60,1,'2022-04-08 07:21:51','2022-04-08 07:21:51'),(41,'两荤两素套餐','食堂三楼\n大鸡排，算两个？',12.00,60,1,'2022-04-08 07:22:18','2022-04-08 07:22:18'),(42,'中间位置','食堂一楼\n菜品随机？',5.00,60,1,'2022-04-08 07:23:08','2022-04-08 07:23:08'),(43,'中间位置','食堂二楼\n菜品随机？？',5.00,60,1,'2022-04-08 07:23:23','2022-04-08 07:23:23'),(44,'麻辣烫自助','食堂二楼\n称重计算价格\n别想了排不上的',10.00,60,1,'2022-04-08 07:24:57','2022-04-08 07:24:57'),(45,'猩红收割者','魔鬼一般的acm参赛选手',10000.00,100,0,'2022-04-17 10:53:08','2022-04-17 10:53:08'),(46,'炒饼','食堂三楼角落\n半份与一份的区别在哪呢',12.00,60,1,'2022-04-28 03:49:47','2022-04-28 03:49:47'),(47,'蛋挞','食堂没了',3.00,60,1,'2022-05-10 10:04:26','2022-05-20 09:34:47'),(48,'奥尔良卷饼','好大一个',6.00,60,1,'2022-05-20 09:25:43','2022-05-20 09:25:43'),(49,'韭菜盒子','暂无',2.00,60,1,'2022-05-20 09:26:25','2022-05-20 09:26:25'),(50,'美式咖啡','建筑好',7.00,60,1,'2022-05-20 09:33:10','2022-05-20 09:33:10'),(51,'奥利奥奶茶','建筑好哇',13.00,60,1,'2022-05-20 09:33:37','2022-05-20 09:33:37');
